<p class="form-info-red">Passwords don't match</p>
<p class="form-info-regular">Profile has been updated successfully.</p>
<form id="student-settings" name="student-settings" method="post" class="student-settings">
	<label><br>
		First Name:<br>
		<input type="text" name="first_name" value="" style="background-image: url(&quot;data:image/png;base64,&quot;); background-repeat: no-repeat; background-attachment: scroll; background-size: 16px 18px; background-position: 98% 50%;"><br>
	</label>
	<p></p>
	<p>	<label><br>
		Last Name:<br>
		<input type="text" name="last_name" value=""><br>
		</label>
	</p>
	<p>	<label><br>
		E-mail:<br>
		<input type="text" name="email" value="john@example.com"><br>
		</label>
	</p>
	<p>	<label><br>
		Username:<br>
		<input type="text" name="username" value="admin" disabled="disabled"><br>
		</label>
	</p>
	<p>	<label><br>
		Password:<br>
		<input type="password" name="password" value="" placeholder="Won't change if empty." style="background-image: url(&quot;data:image/png;base64,&quot;); background-repeat: no-repeat; background-attachment: scroll; background-size: 16px 18px; background-position: 98% 50%;"><br>
		</label>
	</p>
	<p>	<label><br>
		Confirm Password:<br>
		<input type="password" name="password_confirmation" value="" style="background-image: url(&quot;data:image/png;base64,&quot;); background-repeat: no-repeat; background-attachment: scroll; background-size: 16px 18px; background-position: 98% 50%;"><br>
		</label>
	</p>
	<p>	<label class="full"><br>
		<input type="submit" name="student-settings-submit" class="apply-button-enrolled" value="Save Changes"><br>
		</label><br>
	</p>
</form>
